import React from "react";
import Card from "react-bootstrap/Card";
import imgVinyl from "../assets/travis-yewell-F-B7kWlkxDQ-unsplash.jpg";
import "./CameraBanner.css";

const CameraBanner = () => {
  return (
    <Card className="text-white my-5">
      <Card.Img src={imgVinyl} alt="Card image" id="camera-banner" />
      <Card.ImgOverlay>
        <Card.Title>Film Cameras sold here!</Card.Title>
        <Card.Text>
          This is a wider card with supporting text below as a natural lead-in
          to additional content. This content is a little bit longer.
        </Card.Text>
        <Card.Text>Last updated 3 mins ago</Card.Text>
      </Card.ImgOverlay>
    </Card>
  );
};

export default CameraBanner;
